import React, { useState, useEffect } from 'react';
import './App.css';
import AIToolList from './components/AIToolList';
import AIToolDetails from './components/AIToolDetails';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import { CSSTransition, TransitionGroup } from 'react-transition-group';
import { useLocation } from 'react-router-dom';

// Animation component wrapper
const AnimatedRoutes = () => {
  const location = useLocation();
  
  return (
    <TransitionGroup>
      <CSSTransition
        key={location.key}
        timeout={500}
        classNames="page-transition"
      >
        <Routes location={location}>
          <Route path="/" element={<Home />} />
          <Route path="/tool/:id" element={<AIToolDetails />} />
        </Routes>
      </CSSTransition>
    </TransitionGroup>
  );
};

// Home component with parallax effect
const Home = () => {
  const [scrollY, setScrollY] = useState(0);
  
  useEffect(() => {
    const handleScroll = () => {
      setScrollY(window.scrollY);
    };
    
    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  return (
    <div className="home-container">
      <div 
        className="parallax-header"
        style={{ 
          transform: `translateY(${scrollY * 0.5}px)`,
          opacity: 1 - scrollY / 500
        }}
      >
        <h1>AI Tools Directory</h1>
        <p>Discover the best AI tools for your workflow</p>
      </div>
      
      <div className="content-section">
        <AIToolList />
      </div>
    </div>
  );
};

// Navigation component
const Navigation = () => {
  return (
    <nav className="main-nav">
      <div className="logo">AI Tools Hub</div>
      <ul className="nav-links">
        <li><a href="/">Home</a></li>
        <li><a href="/categories">Categories</a></li>
        <li><a href="/about">About</a></li>
      </ul>
    </nav>
  );
};

// Footer component
const Footer = () => {
  return (
    <footer className="main-footer">
      <div className="footer-content">
        <div className="footer-section">
          <h3>AI Tools Hub</h3>
          <p>Your directory for the latest AI tools and resources.</p>
        </div>
        <div className="footer-section">
          <h3>Quick Links</h3>
          <ul>
            <li><a href="/">Home</a></li>
            <li><a href="/privacy">Privacy Policy</a></li>
            <li><a href="/terms">Terms of Service</a></li>
          </ul>
        </div>
        <div className="footer-section">
          <h3>Connect</h3>
          <ul className="social-links">
            <li><a href="#twitter">Twitter</a></li>
            <li><a href="#linkedin">LinkedIn</a></li>
            <li><a href="#github">GitHub</a></li>
          </ul>
        </div>
      </div>
      <div className="copyright">
        © {new Date().getFullYear()} AI Tools Hub. All rights reserved.
      </div>
    </footer>
  );
};

// Main App component
function App() {
  return (
    <BrowserRouter>
      <div className="app">
        <Navigation />
        <main className="main-content">
          <AnimatedRoutes />
        </main>
        <Footer />
      </div>
    </BrowserRouter>
  );
}

export default App;
